@fearhername She'd taken to clearing her head with a walk through the cool night. Cheeks a soft oink shade from the crisp night air.

Unaware of being followed the blonde came to an abrupt halt at the unknown figure appearing out of thin air.

"The same could be said to you.."

Joy Reid just showed the pic of Joe and Jill and said "love also returns to the White House"...

you betta kick off your show with facts AND shade, 
@JoyAnnReid...both are so sorely needed.
